INSERT INTO `tbl_about_us` (`id`, `title`, `image`, `alt_tag`, `description`, `mission_title`, `mission_image`, `mission_description`, `vission_title`, `vission_image`, `vission_description`, `goals_title`, `goals_image`, `goals_description`) VALUES
(1, 'Experience the Unique Style with Creative Designers At Home!', 'Aboutus-18537_image-1.jpg', '', '<p><span style=\"font-weight: 400;\">Retro Touch is an interior design company in Vapi, that offers best-in-class services and unique designs as per the client&rsquo;s requirements. We offer customized as well as ready floor plans and a 3D perspective view of your dream house based on Vastu. We also cater to the online architectural and interior queries by offering consultancy for designing eco-friendly and energy-efficient homes best suited to the environment. <br /></span></p>\r\n<p><span style=\"font-weight: 400;\">Our team design customized plan to suit your requirement, budget, lifestyle, and preference. Our team design customized plan to suit your requirement, budget, lifestyle, and preference. Our targeted search for house plans allows you the easily find the most appropriate plan that meets your requirements.&nbsp;</span></p>', 'Mission', '', '<p><span style=\"font-weight: 400;\">To offer complete satisfaction to our customers by adhering to superior quality products at competitive prices and providing excellent services within the stipulated time.</span></p>', 'Vision', '', '<p><span style=\"font-weight: 400;\">Nicrmo Fasteners Pvt. Ltd. aims to manufacture and supply standardized and high-performance nickel-based alloy fasteners for distribution across the globe with an uncompromising attitude towards quality.&nbsp;</span></p>', 'Core Values', '', '<p><span style=\"font-weight: 400;\">We believe in safety, quality, productivity, and innovation to offer quality products and best-in-class services to our clients. We also try to maintain safe, responsible, and healthy working conditions for our employees.</span></p>');
