INSERT INTO `tbl_services` (`id`, `title`, `image`, `image_alt_tag`, `icon`, `icon_alt_tag`, `sort_desc`, `long_desc`, `page_name`, `meta_tag_id`, `service_link_visibility`, `btn1_name`, `btn1_link`, `btn2_name`, `btn2_link`, `position_order`, `image_type`) VALUES
(5, '3D Floor Plan', 'Products-66729_large_Hatheru-Typical-2BR.jpeg', '', 'Icon-78156_mi-v1-dark-floor_600_huc40f90f4180643adf7ed3addef1726c8_54628_1920x0_resize_q75_lanczos.jpeg', '', '', '<h5>An easy understanding of Your 2D Plan!</h5>\r\n<h5>A 3D floor plan helps in a better understanding of the instinctive designs, decoration of the rooms, the arrangement of furniture, etc. 3D floor plan service offered by us will add a new dimension to your projects, be it residential or commercial. Services offered by retro touch cater to a better understanding of the substance colours, structure and use of place. We place appropriate furniture and other household goods to proffer a comprehensive view of the house with a 3D floor plan.</h5>\r\n<div class=\"text blog-single-post\">\r\n<h5>Work Flow:</h5>\r\n<ul class=\"list\">\r\n<li>Contact our experts to know the work procedure and share your idea.</li>\r\n<li>A detailed discussion about the requirements to help us better understand your requirements.</li>\r\n<li>In our designing phase, our experts design the interior taking care of the minute of the details.</li>\r\n<li>The 2D designed is shown to the client for approval and modification.&nbsp;</li>\r\n<li>Once the design is finalised, the technical work on the site starts.</li>\r\n</ul>\r\n<h5>Why Choose Us:</h5>\r\n<ul class=\"list\">\r\n<li>Affordable and creative and international quality of home design</li>\r\n<li>The professional team at your discretion for on-time delivery</li>\r\n<li>Get all services online along with free consultation</li>\r\n<li>Design changes until satisfaction</li>\r\n</ul>\r\n</div>', '3d-floor-plan.php', 12, 0, '', '', '', '', 2, ''),
(12, '3D Elevation', 'Products-46059_Ashok Soni Option 2_3 - Photo.jpg', '', 'Icon-25990_6681ffffa52a0a9ad9069babfada8d12.jpg', '', '', '<h5>Retrotuch&nbsp;offers&nbsp;a 3D elevation for a better understanding of the idea and look. The&nbsp;elevation&nbsp;is conceptualized to incorporate the minute details and modifications of the floor plan.&nbsp;&nbsp;</h5>\r\n<h5>3D Elevation is created from the elevation line properties and the selected objects in the building model. They are linked to the building model. If you make update the elevation to reflect the changes made in the building model.&nbsp;&nbsp;</h5>\r\n<h5>Work Flow:</h5>\r\n<div class=\"text blog-single-post\">\r\n<ul class=\"list\">\r\n<li>Contact our experts to know the work procedure and share your idea.</li>\r\n<li>A detailed discussion about the requirements to help us better understand your requirements.</li>\r\n<li>In our designing phase, our experts design the interior keeping in mind your requirements.</li>\r\n<li>The 2D design is shown to the client for approval and modification.&nbsp;</li>\r\n<li>Based on the 2D Floor plan 3D elevations are created for approvals.&nbsp;</li>\r\n<li>Once the&nbsp;elevation is finalised, the technical work on the site starts.</li>\r\n</ul>\r\n<h5>Why Choose Us:</h5>\r\n<ul class=\"list\">\r\n<li>Affordable and creative and international quality of home design</li>\r\n<li>The professional team at your discretion for on-time delivery</li>\r\n<li>Get all services online along with free consultation</li>\r\n</ul>\r\n</div>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', '3d-elevation.php', 19, 0, '', '', '', '', 3, ''),
(13, 'Interior Design', 'Products-96164_maxresdefault.jpeg', '', 'Icon-56139_7877c117eaef64dba0e9895c818eb103.png', '', '', '<p>Retro Touch Design Studio is a renowned Interior Designing Studio offering various interior decor services for residential as well as commercial properties.&nbsp;We are known for the quality of their services and customer satisfaction.&nbsp;We help people in making their homes and offices beautiful, spacious, as well as functional.&nbsp;As the top-rated&nbsp;<strong>Interior Designer</strong>, we always make sure that the client&lsquo;s demands are fulfilled by all means.</p>\r\n<p>We will do everything to make your place a happy place! And, it&rsquo;s our assurance that you will receive compliments from all your near and dear ones about your aesthetically designed home, and your employees will be motivated to come to the office which has a combination of pretty, cool, and functional interiors.&nbsp;</p>\r\n<p><strong>Scope of Work</strong></p>\r\n<ul>\r\n<li>Home Interior Designers Commercial Interior Designers</li>\r\n<li>Modular Kitchen Interior Designer</li>\r\n<li>False Ceiling Designer</li>\r\n<li>Residential &amp; Commercial Safety Door Designing</li>\r\n<li>Wall Unit Designs</li>\r\n<li>Bedroom Interior Designing</li>\r\n<li>TV Wall Unit Design</li>\r\n<li>Civil &amp; Plumbing Works</li>\r\n</ul>\r\n<p><strong>Why Choose Us:</strong></p>\r\n<ul class=\"list\">\r\n<li>Affordable and creative and international quality of home design</li>\r\n<li>The professional team at your discretion for on-time delivery</li>\r\n<li>Get all services online along with free consultation</li>\r\n</ul>', 'interior-design.php', 20, 0, '', '', '', '', 7, ''),
(14, '2D Floor Plan', 'Products-56195_planing.PNG', '', 'Icon-11754_yatish planing.PNG', '', '', '<h5>Interpreting your ideas and requirements into Designs!</h5>\r\n<h5>Retrotuch provides a floor plan which is technically sound and covers all your requirements. The floor plan is conceptualized to incorporate the minute details and modifications as per the client.&nbsp;</h5>\r\n<h5>And one of the best home designing and interior designer company, Retrotouch offers you the most suitable read-made as well as customised floor plan according to the Vastu which meets your needs and fits your budget. We provide floor plans for residential as well as commercial projects.&nbsp;</h5>\r\n<div class=\"text blog-single-post\">\r\n<h5>Work Flow:</h5>\r\n<ul class=\"list\">\r\n<li>Contact our experts to know the work procedure and share your idea.</li>\r\n<li>A detailed discussion about the requirements to help us better understand your requirements.</li>\r\n<li>In our designing phase, our experts design the interior keeping in mind your requirements.</li>\r\n<li>The 2D design is shown to the client for approval and modification.&nbsp;</li>\r\n<li>Once the design is finalised, the technical work on the site starts.</li>\r\n</ul>\r\n<h5>Why Choose Us:</h5>\r\n<ul class=\"list\">\r\n<li>Affordable and creative and international quality of home design</li>\r\n<li>The professional team at your discretion for on-time delivery</li>\r\n<li>Get all services online along with free consultation</li>\r\n</ul>\r\n</div>', '2d-floor-plan.php', 21, 0, '', '', '', '', 1, ''),
(11, '3D Animation', 'Products-96675_maxresdefault.jpeg', '', 'Icon-94240_Construction-Projects-must-use-3D-Animation.jpeg', '', '3D Animation', '<h5>Retrotuch&nbsp;offers&nbsp;a 3D&nbsp;Animation&nbsp;for a better understanding of the idea and look. The&nbsp;elevation is animated to incorporate the minute details and modifications of the floor plan.&nbsp;</h5>\r\n<h5>3D Animation is created with special animation effects to see the 360-degree view of the residential/commercial floor plan.&nbsp; Utmost care is taken to show as real and effective a plan as possible for a better view of the look of the property.&nbsp;</h5>\r\n<h5>Work Flow:</h5>\r\n<div class=\"text blog-single-post\">\r\n<ul class=\"list\">\r\n<li>Contact our experts to know the work procedure and share your idea.</li>\r\n<li>A detailed discussion about the requirements to help us better understand your requirements.</li>\r\n<li>In our designing phase, our experts design the interior keeping in mind your requirements.</li>\r\n<li>The 2D design is shown to the client for approval and modification.&nbsp;</li>\r\n<li>Based on the floor plan elevations are created for approvals.&nbsp;</li>\r\n<li>Based on the elevations, 3D animations are created for better visualisation.&nbsp;</li>\r\n<li>Once the&nbsp;elevation is finalised, the technical work on the site starts.</li>\r\n</ul>\r\n<h5>Why Choose Us:</h5>\r\n<ul class=\"list\">\r\n<li>Affordable and creative and international quality of home design</li>\r\n<li>The professional team at your discretion for on-time delivery</li>\r\n<li>Get all services online along with free consultation</li>\r\n</ul>\r\n</div>', '3d-animation.php', 18, 0, '', '', '', '', 5, ''),
(8, 'Structural Design', 'Products-16514_Section Sample.jpg', '', 'Icon-13818_Center Line.jpg', '', '', '<h5>A detailed plan to construct a safe and strong building structure!</h5>\r\n<h5>A structural design is a plan showing the building structure will be built. Detailed work is done in structural planning which includes foundation and dimensions, framing, beam and column, and wall sections. Retrotouch has experts who designed a well-planned structure for the building taking utmost care about the variable loads, choice of materials, stress resistance, and much more. A strong foundation is ideal for the long life of the building. We design and analyse high rise structures for both commercial and residential building.</h5>\r\n<div class=\"text blog-single-post\">\r\n<h5>Work Flow:</h5>\r\n<ul class=\"list\">\r\n<li>Contact our experts to know the work procedure and share your idea.</li>\r\n<li>A detailed discussion about the requirements to help us better understand your requirements.</li>\r\n<li>In our designing phase, our experts design the interior taking care of the minute of the details.</li>\r\n<li>The 2D designed is shown to the client for approval and modification.&nbsp;</li>\r\n<li>Once the design is finalised, the technical work on the site starts.</li>\r\n</ul>\r\n<h5>Why Choose Us:</h5>\r\n<ul class=\"list\">\r\n<li>Affordable and creative and international quality of home design</li>\r\n<li>The professional team at your discretion for on-time delivery</li>\r\n<li>Get all services online along with free consultation</li>\r\n<li>Design changes until satisfaction</li>\r\n</ul>\r\n</div>', 'structural-design.php', 15, 0, '', '', '', '', 6, ''),
(9, 'MEP Designing', 'Products-15234_Last1.jpg', '', 'Icon-27914_Last2.jpg', '', '', '<h5>MEP designing refers to the designing of Mechanical, Electrical, and Plumbing aspects. Although not appealing these are important aspects that need to be considered to enhance the aesthetic value of the house designing. Experts at Retrotouch will plan and document the accurate placements of the mechanical, electrical, and plumbing work for offering a more appealing look to your residential or commercial space. MEP designing is important for planning, decision making, accurate documentation, performance, and cost-estimation, construction and operating/maintaining the facilities.</h5>\r\n<div class=\"text blog-single-post\">\r\n<h5>Work Flow:</h5>\r\n<ul class=\"list\">\r\n<li>Contact our experts to know the work procedure and share your idea.</li>\r\n<li>A detailed discussion about the requirements to help us better understand your requirements.</li>\r\n<li>In our designing phase, our experts design the interior taking care of the minute of the details.</li>\r\n<li>The 2D designed is shown to the client for approval and modification.&nbsp;</li>\r\n<li>Once the design is finalised, the technical work on the site starts.</li>\r\n</ul>\r\n<h5>Why Choose Us:</h5>\r\n<ul class=\"list\">\r\n<li>Affordable and creative and international quality of home design</li>\r\n<li>The professional team at your discretion for on-time delivery</li>\r\n<li>Get all services online along with free consultation</li>\r\n<li>Design changes until satisfaction</li>\r\n</ul>\r\n</div>', 'mep-designing.php', 16, 0, '', '', '', '', 4, '');
