(1, 'Dezzling Dessigners', 'Logo-45151_main-logo (1).png', 'Logo-40935_main-logo (1).png', 'Loader_BG-23827_logo.png', '', 'Favicon-57976_favicon.png', '', '', '', '1.0.0', 'UB Softec', '+91-9427006987', '', '<p>demo</p>', 'UB Softec', '<h1><strong>R&amp;D Technosoft Privacy Policy</strong></h1>\r\n\r\n<p>R&amp;D Technosoft &nbsp;values your privacy and we are committed to protecting your privacy. So we&#39;ve developed a Privacy Policy. When you use our services (including mobile applications), we may collect and use your related information. Important, you should not install R&amp;D Technosoft Apps&nbsp;products in the event that you do not consent with this privacy policy. Please take a moment to familiarize yourself with our privacy practices and let us know if you have any questions.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Personal Information</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>We DO NOT collect, store or use any personal information while you visit, download or upgrade our products, your personal information like your first name and last name, physical addresses, email addresses, telephone numbers, media files and information stored within your device. We will not collect or store your Personal Information and we will not use, transfer or disclose your Personal Information, excepting the personal information that you submit to us when you send an error report or participate in online surveys and other activities. In the following circumstances, we may disclose your personal information according to your wish or regulations by law:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Your prior permission.</strong></p>\r\n\r\n<p>By the applicable law within or outside your country of residence, legal process, litigation requests.</p>\r\n\r\n<p>By requests from public and governmental authorities.</p>\r\n\r\n<p>To protect our legal rights and interests.</p>\r\n\r\n<p>Non-Personal Information</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>We collect your non-personal information when you are using our, including your device information, operation system, logs. We may collect the information you provided to us. Please make sure that you will not send us or disclose any sensitive information such as information related to racial or ethnic origin, political opinions, religious or other beliefs, health information, sexual orientation, criminal background or membership of past organizations, including trade union memberships. We will not sell, trade, or transfer your information to any third party. We will not combine Non-Personal Information with Personal Information, such as combining your unique User Device number with your name. We may use your Information for the following purposes:</p>\r\n\r\n<p><strong>&nbsp;</strong></p>\r\n\r\n<p><strong>To provide our services to you.</strong></p>\r\n\r\n<p>To assure the safety of products and services we offer via using your information on identification-check, customer services, security, fraud-detection, archives and backups when we are providing you with our services.</p>\r\n\r\n<p>To help us develop new services and improve our existing services.</p>\r\n\r\n<p>To better understand how you access and use our services, for the purposes of improving and personalizing our services to better respond your desires and preferences, including language and location setting, personalized services, help and instructions, or other responses to you and other customers on other aspects of our services.</p>\r\n\r\n<p>To evaluate the effect of advertisements and other marketing scheme we put in our services and improve it.</p>\r\n\r\n<p>To verify software or administer software upgrades.</p>\r\n\r\n<p>To allow you to participate in surveys about our products and services.</p>\r\n\r\n<p>Information Security</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>R&amp;D Technosoft Apps are very concerned about safeguarding the confidentiality of your information. We will not collect Personal Information, in the meanwhile we employ administrative, physical and electronic measures designed to protect your Non-Personal Information from unauthorized access and use.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Children</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>We do not collect, use or disclose personal information from children. If you are under 13, you may use our applications when you are with a parent or guardian. We do not provide service focus on Children.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Changes to our Privacy Policy</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Our Privacy Policy may change from time to time, we will post any privacy policy changes on this page, so please review it periodically.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Contacting Us</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>If you have any questions or concerns about our Privacy Policy or data processing, please contact us at:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a href=\"mailto:rndtechnosoft@gmail.com\" target=\"_blank\">rndtechnosoft@gmail.com</a></p>\r\n', '<h1><strong>R&amp;D Technosoft Term &amp; Condition</strong></h1>\r\n\r\n<p>R&amp;D Technosoft &nbsp;values your privacy and we are committed to protecting your privacy. So we&#39;ve developed a Privacy Policy. When you use our services (including mobile applications), we may collect and use your related information. Important, you should not install R&amp;D Technosoft Apps&nbsp;products in the event that you do not consent with this privacy policy. Please take a moment to familiarize yourself with our privacy practices and let us know if you have any questions.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Personal Information</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>We DO NOT collect, store or use any personal information while you visit, download or upgrade our products, your personal information like your first name and last name, physical addresses, email addresses, telephone numbers, media files and information stored within your device. We 