INSERT INTO `tbl_testimonial` (`id`, `name`, `design`, `image`, `alt_tag`, `long_desc`, `position_order`) VALUES
(1, 'Ravi Shah', 'RND Technosoft, Founder', 'Testimonial-4892_ravi.jpg', 'image', '<p>Retro Touch has a great team and friendly relation, they designed the ideal house as per my needs and desire. They have done fantastic work, we are very happy! They were recommended to us by a friend and now we recommend them.</p>', 1),
(2, 'Saloni Shah', 'Yellow Stairs, Owner', 'Testimonial-30305_solani.jpg', '', '<p>Retro Touch turned my house into a home. At the end, it was better than I could have ever imagined. We love it!&rdquo;</p>', 2),
(4, 'Vinay Phalod', 'Social Worker', 'Testimonial-53479_vinay.jpg', '', '<p>Best decision ever! There are no words to express the wonderful and beautiful work they have done for us. They took our house and transformed it completely. They read us, understood our needs, and captured our style with unbelievable professionalism. They are able to go beyond their profound knowledge and connect with the client, so each detail in our home says something about us as a family. We keep rediscovering it as time passes by. There is no place we rather are than home, and part of that feeling we definitely have to thank Retro Touch for.</p>', 3),
(3, 'Bhavika Surti', 'Director', 'Testimonial-4863_bhavika.jpg', '', '<p>Working with Retro Touch\'s team is working with glamour, responsibility, and commitment. They will work with your needs and help you going through the transition of renovating your home. Great company to work with, dedicated and passionate team.</p>', 4);
